&quot;In hoc signe vince[s]. Philippi Archinti&quot;

&quot;In hoc signo vinces&quot; is a Latin rendering of the Greek phrase &quot;ἐν τούτῳ νίκα&quot;, en toutoi nika, meaning &quot;in this sign you will conquer&quot;. Cf. <a href="http://en.wikipedia.org/wiki/In_hoc_signo_vinces" rel="nofollow">Wikipedia</a>

This could be Archinto, Filippo ( 1500-1558)  Italian theologian  and diplomat.

