Pro novitiate augustano
Conventus Augustani F.F. Pr[ae]dicatorum.

&quot;Fuit codex hic pulch. Io. Bapt. Zapata, inde Marci Foscarini Van. [?] Ducis, nunc Iulii Bernardini Pompei F. Tomitani civ. apitergini [?] ...&quot;

&quot; Le [...] linee sono di mano del [...] libre Conti Giulio Bernardino Tomitani, bibliofilo rarissimo; e l’avero appartenuto questo bello e pregiatissimo libro al celebre Doge Marco Foscarini e provato dal trovarsi descritto a pagina 45 notto il [...] del volume intitulato Catalogo della Biblioteca Foscarini ai Carmini vendibile a Venezia nell’anno 1800.&quot;

The three former owners in the inscriptions are:
Giovanni Battista Zapata. Established heading: Zapata, Giovanni Battista, b. ca. 1520 
Marco Foscarini. Established heading: Foscarini, Marco, 1695-1763.
Giulio Bernardino Tomitano, 1761-1828. <a href="http://viaf.org/viaf/52124291/#Tomitano,_Giulio_Bernardino,_1761-1828" rel="nofollow">viaf.org/viaf/52124291/#Tomitano,_Giulio_Bernardino,_1761...</a>

