&quot;M:K&quot;
Motto : Ascendam (I will rise)

This bookplate depicts the arms of the Kenneway family of Devonshire, as described in Burke's Peerage (Google Books has the 76th edition, 1914, formally titled &quot;A Genealogical and Heraldic History of the Peerage and Baronetage, the Privy Council, Knightage and Companionage,&quot; published by Harrison and Sons in the U.K. and Putnams in New York.).  The family and its arms are described on pages 1102-1103.  The latter are described as follows:
&quot;Arg., a fease az., between two eagles displayed in chief, and in base, through an annulet of the third, a slip of olive an another of palm in saltier ppr.  Crest--an eagle rising ppr.; from the beak an escutcheon pendant az., charged with the sun in splendor also ppr.  Motto--Ascendam.&quot;
The version of the arms in this bookplate lacks the additional accouterments of a baronet, indicating that it belongs to a member of the family not holding the title.  As of 1914, only two listed members of the family had a first name beginning with the letter &quot;M&quot;:  (1) Mariona Kenneway, daughter of the Rev. Charles Edward Kenneway, younger brother of the second baronet, and (2) Mark John Kenneway (b. 25 April 1880), second son of the second baronet.  According to another internet source, &quot;thePeerage.com/p44019.htm,&quot; he died on 17 March 1960, and among his children was a daughter Mary Elizabeth Kenneway.  So I guess that gives us 3 candidates for this bookplate.  A review of a more recent edition of Burke's Peerage might turn up additional ones.
